import React, { useState, useEffect } from "react";
import "../style/Results.css";

function Results() {

    const [layovers, setLayovers] = useState(0);
    const [cost, setCost] = useState(0);
    const [time, setTime] = useState(0);

    return (

        <div className="App">

            <div class="header" className="App-header">
                <h1>dinoSOAR</h1>
            </div>
            <div className="App-body">
                <div className="Slider">
                    <h1>Layover Limits</h1>
                    <p>Move the slider to select how many layovers you are okay with having on your trip.</p>
                    <input
                        max={5}
                        type="range"
                        value={layovers}
                        onChange={(e) => setLayovers(e.target.valueAsNumber)}
                    />
                    <p>Total allowed layovers: {layovers}</p>
                </div>
                <div className="Slider">
                    <h1>Cost Limits</h1>
                    <input
                        max={100}
                        type="range"
                        value={cost}
                        onChange={(e) => setCost(e.target.valueAsNumber)}
                    />
                </div>
                <div className="Slider">
                    <h1>Time Limits</h1>
                    <input
                        max={100}
                        type="range"
                        value={time}
                        onChange={(e) => setTime(e.target.valueAsNumber)}
                    />
                </div>
            </div>
        </div>
    );
}

export default Results;
